   // Set up debounced search\n    this.searchSubject.pipe(\n      debounceTime(300), // Wait 300ms after last input\n      distinctUntilChanged(), // Only emit if value changed\n      filter(term => {\n        // Validate NSS format (assuming it should be numeric and have a minimum length)\n        const numericTerm = parseInt(term, 10);\n        return !isNaN(numericTerm) && term.length >= 5; // Adjust minimum length as needed\n      })\n    ).subscribe(term => {\n      this.search.emit(parseInt(term, 10));\n    });\n  }\n\n  onSearchChange(value: string): void {\n    this.searchSubject.next(value);\n  }\n\n  onScanQR(): void {\n    this.scanQR.emit();\n  }\n}\n    \n\n    \n        \n  \n    \n      \n      \n      \n    \n    Scanner QR\n  \n  \n    \n      \n      \n    \n  \n\n\n\n\n\n    \n\n\n    \n        \n        \n            \n                Legend\n            \n            \n                Html element\n            \n            \n                Component\n            \n            \n                Html element with directive\n            \n        \n    \n\n    \n\n\n\n\n\n\n        var COMPONENT_TEMPLATE = '                                Scanner QR                          '\n    var COMPONENTS = [{'name': 'AddDPIComponent', 'selector': 'app-add-dpi'},{'name': 'AppComponent', 'selector': 'app-root'},{'name': 'BienvenuComponentComponent', 'selector': 'app-bienvenu-component'},{'name': 'BilanComponent', 'selector': 'app-bilan'},{'name': 'ConsulterDPIPovPatientComponent', 'selector': 'app-consulter-dpipov-patient'},{'name': 'ConsultPatientComponent', 'selector': 'app-consult-patient'},{'name': 'HeaderComponent', 'selector': 'app-header'},{'name': 'HomePageComponent', 'selector': 'app-home-page'},{'name': 'InfermierLandingPageComponent', 'selector': 'app-infermier-landing-page'},{'name': 'InfermierTableComponent', 'selector': 'app-infermier-table'},{'name': 'LaborantinComponent', 'selector': 'app-laborantin'},{'name': 'LaboTableComponent', 'selecto